import { ref, Ref } from 'vue'
import { ISheet } from "@/types/interfaces";

class ConfigService {
    private sheetDef: Ref<ISheet | undefined>;
    
    constructor() {
        this.sheetDef = ref();
/*        this.gap = sheetDef.value.config?.gap !== undefined ? sheetDef.value.config.gap : 4;
        this.favicon = sheetDef.value.config?.favicon !== undefined ? sheetDef.value.config.favicon : stdFavicon;
        this.pageTitle = sheetDef.value.config?.pageTitle !== undefined ? sheetDef.value.config.pageTitle : "Character Sheet"*/
    }

    public setSheetDef(sheetDef: ISheet) {
        this.sheetDef = ref(sheetDef);
    }

    public getSheetDef(): ISheet {
        if (this.sheetDef.value == undefined) {
            throw "No sheet def was defined!";
        }
        return this.sheetDef.value;
    }

    public getGap(): number {
        return this.sheetDef.value?.config?.gap !== undefined ? this.sheetDef.value.config.gap : 4;
    }

    public getFavicon(): string {
        return this.sheetDef.value?.config?.favicon !== undefined ? this.sheetDef.value.config.favicon : stdFavicon;
    }

    public getPageTitle(): string {
        return this.sheetDef.value?.config?.pageTitle !== undefined ? this.sheetDef.value.config.pageTitle : "Character Sheet";
    }
}

const configService = new ConfigService();

export function useConfig(): ConfigService {
    return configService;
}

const stdFavicon: string = "data:image/png;base64,"